from django.db import models

# Create your models here.

class LawnItem(models.Model):

    def __str__(self):
        return self.lawn_name

    lawn_name = models.CharField(max_length=200)
    lawn_image = models.CharField(max_length=50000, default="data:image/jpeg;base64,")


class PestItem(models.Model):

    def __str__(self):
        return self.pest_name

    pest_name = models.CharField(max_length=200)
    pest_image = models.CharField(max_length=50000, default="data:image/jpeg;base64,")


class TreeItem(models.Model):

    def __str__(self):
        return self.tree_name

    tree_name = models.CharField(max_length=200)
    tree_image = models.CharField(max_length=50000, default="data:image/jpeg;base64,")


class AdviceForm(models.Model):
    def __str__(self):
        return self.firstname

    firstname = models.CharField(max_length=200)
    lastname = models.CharField(max_length=200)
    advice = models.CharField(max_length=5500)

class LawnCalc(models.Model):

    def __str__(self):
        return self.gallons

    lawngallons = models.IntegerField()
    lawnsquarefootage = models.IntegerField()


class PestCalc(models.Model):

    def __str__(self):
        return self.gallons

    pestgallons = models.IntegerField()
    pestsquarefootage = models.IntegerField()


class TreeCalc(models.Model):

    def __str__(self):
        return self.gallons

    treegallons = models.IntegerField()
    treesquarefootage = models.IntegerField()

